import React, { Component } from "react"
import Social from '../component/Social'
// import profilepic from  '../img/Smartfarm2.jpg'


class Home extends Component {
    render() {
        return (
            <div className="condiv home">
                <img src=" https://scontent.fhan14-3.fna.fbcdn.net/v/t39.30808-6/324236833_679829557263656_6492786423682771594_n.jpg?stp=cp6_dst-jpg&_nc_cat=109&ccb=1-7&_nc_sid=8bfeb9&_nc_eui2=AeEC2gH4Ve3n4YPTWcrgsax8zfMBhXzaB7jN8wGFfNoHuG-8cMNOcCKSYN4Rv4cIPq2WZRA2wLwdeIKFeNdFgXJO&_nc_ohc=_iLkSmdPZo0AX-tBx3U&_nc_ht=scontent.fhan14-3.fna&oh=00_AfC3OAueYbW5cP4LRkUobjmbi-bOyi8zPRVHOFw9jABQTA&oe=63BEFF89" alt="profile" className="profilepic"/>
                <p className="typingeffect">I'm JienAdam</p>
                 <Social />
                 </div>
        )
    }
}

export default Home;
